import { useState, useEffect} from 'react';
import '../index.css';
import Header from './Header.js';
import Footer from './Footer.js';
import Main from './Main.js';
import PopupWithForm from './PopupWithForm.js';
import ImagePopup from './ImagePopup.js';
import { api } from '../utils/Api';

function App() {

  const [isEditAvatarPopupOpen, setEditAvatarPopupOpen] = useState(false);
  const [isEditProfilePopupOpen, setEditProfilePopupOpen] = useState(false);
  const [isAddPlacePopupOpen, setAddPlacePopupOpen] = useState(false);
  const [isZoomPopupOpen, setZoomPopupOpen] = useState(false);
  const [selectedCard, setSelectedCard] = useState({});

  const [currentUser, getUserInfo] = useState([]);

  function requestData() {
  api.getUserInfo() 
    .then((profileInfo)=> {
      getUserInfo(profileInfo);
    })
    .catch((err) => {
      console.log(err);
    }) }

    useEffect(() => {
      requestData()
    }, []) 

  function handleEditAvatarClick () {
    setEditAvatarPopupOpen(true);
  }

  function handleEditProfileClick () {
    setEditProfilePopupOpen(true);
  }

  function handleAddPlaceClick () {
    setAddPlacePopupOpen(true);
  }

  function handleZoomClick () {
    setZoomPopupOpen(true);
  }

  function closeAllPopups () {
      setEditAvatarPopupOpen(false);
      setEditProfilePopupOpen(false);
      setAddPlacePopupOpen(false);
      setZoomPopupOpen(false)
    }

  function handleCardClick(card) {
    setSelectedCard(card);
    handleZoomClick();
  } 

  return (

    <div className="page__container">
      <Header />

      <Main 
      onEditAvatar = {handleEditAvatarClick}
      onEditProfile = {handleEditProfileClick}
      onAddPlace = {handleAddPlaceClick}
      onCardClick = {handleCardClick}

      />

      <Footer />

      <PopupWithForm
        name='profile'
        popupTitle='Редактировать профиль'
        buttonTitle='Сохранить'
        isOpen={isEditProfilePopupOpen}
        onClose = {closeAllPopups}

        >
        <div className="field-container">
          <input id="name-input" className="popup__input" name="surname" type="text" placeholder="Имя" required minLength="2" maxLength="40" />
          <span className="name-input-error" id="name-error"></span>
        </div>
        <div className="field-container">
          <input id="job-input" className="popup__input" name="job" type="text" placeholder="Профессия" required minLength="2" maxLength="200" />
          <span className="job-input-error" id="job-error"></span>
        </div>
      </PopupWithForm>


      <PopupWithForm

        name='add'
        isOpen={isAddPlacePopupOpen}
        onClose = {closeAllPopups}
        popupTitle='Новое место'
        buttonTitle='Сохранить'>
        <div className="field-container">
          <input id="place-input" className="popup__input" name="name" type="text" placeholder="Название" required minLength="2" maxLength="30" />
          <span className="place-input-error" id="place-error"></span>
        </div>
        <div className="field-container">
          <input id="link-input" className="popup__input" name="link" type="url" placeholder="Ссылка на картинку" required />
          <span className="link-input-error" id="link-error"></span>
        </div>
      </PopupWithForm>

      <PopupWithForm
        isOpen={false}
        name='delete'
        popupTitle='Вы уверены?'
        buttonTitle='Да'>
      </PopupWithForm>

      <PopupWithForm
        name='avatar'
        isOpen={isEditAvatarPopupOpen}
        onClose = {closeAllPopups}
        popupTitle='Обновить аватар'
        buttonTitle='Сохранить'>
        <div className="field-container">
          <input id="avatar-input" className="popup__input" name="avatar" type="url" placeholder="Ссылка на картинку" required />
          <span className="avatar-input-error" id="avatar-error"></span>
        </div>
      </PopupWithForm>

      <ImagePopup
        card = {selectedCard}
        onClose = {closeAllPopups}
        isOpen = {isZoomPopupOpen}
      >
      </ImagePopup>
    </div>
  );
}

export default App;
